document.addEventListener("DOMContentLoaded",function(){document.querySelectorAll("a[data-tracking]").forEach(function(e){e.addEventListener("click",function(e){let target=e.target.closest("a[data-tracking]");jsonData=JSON.parse(target.getAttribute("data-tracking")),console.log("jsonData",jsonData),window.TrackingFacade.sendEvent("select_item",{currency:"BRL",value:0,origin:window.location.pathname,ecommerce:{items:[{item_name:jsonData.name,item_id:jsonData.id,price:0,item_brand:"SIRIO-LIBANES",item_category:jsonData.category||"POS-GRADUACAO",item_type:jsonData.type,index:1,quantity:1}]}})})})});
